    return(
      <section>
        <div>
          Free shipping from $50
        </div>
        <div>
          <img src={logo} alt="Fresh"/>
          <div>
          <Link to='/about'>About</Link>
          <Link to='/shop'>Shop</Link>

          </div>
        </div>
      </section>

    );
  }

  export default Header;
